const ItemsList = ({items})=>{
    console.log(items);
    return <div className="p-4 my-4">
        <div>
            {items.map((item)=>(
        <div key={item.card.info.id}>
            <span>{item.card.info.name}</span>
            <span>{item.card.info.price/100} RS</span>
            <p>{item.card.info.description}</p>
        </div>

            ))}
        </div>
    </div>;
}
export default ItemsList;
